// 16x2x2 => 10x2x2
void op_Conv_9(void* in, void* out)
{
  float (*i)[16][2][2];
  i = (typeof(i))(in);
  float (*o)[10][2][2];
  o = (typeof(o))(out);

  {
    float *p = (float*)((*o));
    for(int c=0;c < 10;c++) {
      int cnt=0;
      while(cnt++ < 2*2) {
        *p++ = layer_conv4_0_bias[c];
      }
    }
  }

  for(int c_i=0;c_i < 16;c_i++) {
    for(int m=0;m < 1;m++) {
      for(int n=0;n < 1;n++) {
        for(int c=0;c<10;c++) {
          float t = layer_43[c][c_i][m][n];
          if(float_IS_ZERO(t))
            continue;
          for(int x=0;x<2;x++) {
            for(int y=0;y<2;y++) {
              (*o)[c][x][y] += (*i)[c_i][x+m][y+n] * t;
            }
          }
        }
      }
    }
  }
}


//node

void op_AveragePool_11(void* in, void* out)
{
  float (*i)[10][2][2];
  i = (typeof(i))(in);
  float (*o)[10][1][1];
  o = (typeof(o))(out);

  for(int c=0;c<10;c++) {
    for(int x=0, o_i=0;x<2;x+=2) {
      for(int y=0, o_j=0;y<2;y+=2) {
        float result=0;
        for(int m=0;m<2;m++) {
          for(int n=0;n<2;n++) {
              result += (*i)[c][x+m][y+n];
          }
        }
        (*o)[c][o_i][o_j] = result/(2*2);
        o_j++;
      }
      o_i++;
    }
  }
}


void Model(void* input, void* output)
{
  op_Conv_0(input, buf1);
  op_Relu_1(buf1, NULL);
  op_MaxPool_2(buf1, buf2);
  op_Conv_3(buf2, buf1);
  op_Relu_4(buf1, NULL);
  op_MaxPool_5(buf1, buf2);
  op_Conv_6(buf2, buf1);
  op_Relu_7(buf1, NULL);
  op_MaxPool_8(buf1, buf2);
  op_Conv_9(buf2, buf1);
  op_AveragePool_11(buf1, output);
}

